/* global $ */

function onKanjiClick (self) {
  if (!$(self).data('tooltip')) {
    const kanji = $(self).text()
    const kanjiIndex = kanjiIndices[kanji]
    let error = ''
    let kanjiUrl
    if (kanjiIndex === undefined) {
      error = 'Кандзи не найден в словаре'
    } else { kanjiUrl = 'kanji/' + articleNumberToLink(kanjiIndex) }
    $(self).tooltip({
      position: { my: 'left top', at: 'left bottom-4', collision: 'flipfit' },
      items: '*',
      content: function (callback) {
        if (error !== '') {
          return error
        }

        $.get({
          url: kanjiUrl,
          dataType: 'html'
        }
        ).done(function (data) {
          callback(data)
        }
        ).fail(function () {
          const err = 'Кандзи не найден на сайте'
          callback(err)
        }
        )
      },
      open: function (event, ui) {
        const $element = $(event.target)
        ui.tooltip.click(function () {
          $element.tooltip('destroy')
          $(self).data('tooltip', false)
        })
      }
    })
    $(self).tooltip('open')
    $(this).data('tooltip', true)
  } else {
    $(self).tooltip('destroy')
    $(self).data('tooltip', false)
  }
}

$(document).ready(function () {
  $('.kanji_widget').on('click', function (event, ui) {
    onKanjiClick(this)
  })
    .on('tooltipopen', function (event, ui) {
      $(this).data('tooltip', true)
    })
    .on('tooltipclose', function (event, ui) {
      $(this).data('tooltip', false)
    })
    .on('mouseout focusout', function (event) {
      event.stopImmediatePropagation()
    })
})

function articleNumberToLink (kanjiNumber) {
  const kanjiPerDir = 100
  let dirNumber = Math.floor(kanjiNumber / kanjiPerDir)
  dirNumber = dirNumber === 0 ? 1 : dirNumber * kanjiPerDir

  // 0001/0001.html, ..., 0900/0900.html, ...
  return padByZero(dirNumber, 4) + '/' + padByZero(kanjiNumber, 4) + '.html'
}

function padByZero (num, size) {
  let s = num.toString()
  while (s.length < size) { s = '0' + s }
  return s
}

